import Header from '../../components/main_page/header/Header';
import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';

import { LoadAllAdminData } from './LoadAllDataAdmin';


import React, { Component } from 'react';

function AdminPage() {

    axios.get("http://localhost:8080/admin/find/" + sessionStorage.getItem())

    return (
        <div className="">
            <LoadAllAdminData />
            <Header
                type="ADMIN" />
            {/* <UserHomeLayout 
                    type="ADMIN" /> */}
        </div>
    );

}

export default AdminPage;
